import Card from './Card';

function App() {
  return (
    <div className="App">
      <h1>Hello</h1>
      <Card name='Himanshu' title="Working"> 
        <button className="button">Yes</button>
        <button className="button button3">No</button></Card>
      <Card name='Ankush' title="Working" />
      <Card name='Afsar' title="Learning React" />
    </div>
  );
}

export default App;
